const model = {

  fontStyle: ['st1', 'st2', 'st3', 'st4', 'st5', 'st6', 'st7'],
  weekdayStyle: ['v1', 'v2', 'v3', 'v4'],
  dayStyle: ['t1', 't2', 't3', 't4', 't5', 't6'],
  largeCircles: {
    sides: {
      vSides: {
        top: {
          from: -300,
          to: -100
        },
        bottom: {
          from: -300,
          to: -100
        }
      },
      hSides: {
        left: {
          from: -300,
          to: -100
        },
        right: {
          from: -300,
          to: -100
        }
      }
    },
    sizes: {
      small: {
        from: 400,
        to: 1000
      },
      large: {
        from: 800,
        to: 2000
      }
    }
  },
  texts: {
    strings: [
      'Life is too short to hold grudges, unless you are a professional grudge holder and it pays the bills.',
      'It is never too late to apologize and make amends, even if you accidentally set fire to your neighbor`s lawn gnome collection.',
      'What we gonna do with this situation?',
      'OK, another month has started, let`s try again',
      'What are you thinking about?',
      'A month is a unit of time, used with calendars, that is approximately as long as a natural orbital period of the Moon. the words month and Moon are cognates. The traditional concept arose with the cycle of Moon phases. Such lunar months ("lunations") are synodic months and last approximately 29.53 days.'
    ],
    sides: ['top', 'center', 'bottom']
  }
}

export { model }
